import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';
import RoadLevel6 from '../RoadLevels/RoadLevel6'
import RadarExample from './test'
function RoadLevel5(props) {

    var options = {
      sclaes:
      {
        yAxes: [{
          ticks: {
            display: false
          },
          gridLines: {
            drawBorder: false,
            display: false,
            tickMarkLength: false
          }          
        }],
        xAxes: [{
          ticks: {
            display: false
          },
          gridLines: {
            drawBorder: false,
            display: false,
            tickMarkLength: false
          }          
        }]
      }
    }

    return (
        <div>
          <div style={{display:'flex',flexDirection:'column'}}>
            <div style = {{display: 'flex', flexDirection: 'row', alignItems: 'center'}}>                
                <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                 <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                 <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                 <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                <FlipCard
                  width = {"25em"}
                  height = {"25em"}
                  FlipStyle = {{backgroundColor:'white', color:'black'}}
                  Front=
                  {
                    <div>
                      <h1 className = 'progLang-hF'>
                      {props.softSkillsChartData.frontTitle}
                      </h1>
                      <p style= {{position: 'fixed', bottom: -16, right:0, color:'yellow'}}>
                        {props.softSkillsChartData.clickMessage}
                      </p>
                    </div>
                  }
                  Back = {
                    <div>
                      <Radar 
                      data = {props.softSkillsChartData}
                      />
                    </div>
                      }
                >
                </FlipCard>
            </div>
          </div>
        </div>
        )              
}

export default RoadLevel5;
